import React, { useState, useEffect } from 'react';
import { useParams } from 'react-router-dom';
import { Button, TextField, Typography, Container, Grid } from '@mui/material';
import axios from 'axios';

interface MatchData {
  match: string;
  blueAlliance: number[];
  redAlliance: number[];
}

const ScanningScreen: React.FC = () => {
  const { district, matchNumber } = useParams<{ district: string; matchNumber: string }>();
  const [matchData, setMatchData] = useState<MatchData | null>(null);
  const [scannedTeams, setScannedTeams] = useState<string[]>([]);
  const [inputValue, setInputValue] = useState<string>('');

  useEffect(() => {
    const fetchMatchData = async () => {
      try {
        const response = await axios.get(`http://localhost:8080/matches/${district}/${matchNumber}`);
        const responseData = response.data;

        setMatchData({
          match: matchNumber || '',
          blueAlliance: responseData.body.slice(0, 3),
          redAlliance: responseData.body.slice(3),
        });
      } catch (error) {
        console.error('Error fetching match data:', error);
      }
    };

    fetchMatchData();
  }, [district, matchNumber]);

  const handleInputChange = (event: React.ChangeEvent<HTMLInputElement>) => {
    setInputValue(event.target.value);
  };

  const handleAddTeam = async () => {
    const teamData = `"${inputValue}"`;
    try {
      await axios.post('http://localhost:8080/impi/add', teamData, {
        headers: {
          'Content-Type': 'text/plain',
        },
      });
      setScannedTeams([...scannedTeams, inputValue.split(',')[1]]);
      setInputValue('');
    } catch (error) {
      console.error('Error adding team:', error);
    }
  };

  const isTeamScanned = (teamNumber: number) => {
    return scannedTeams.includes(String(teamNumber));
  };

  const handleNextMatch = () => {
    const nextMatchNumber = parseInt(matchNumber || '0') + 1;
    window.location.href = `/ScanningScreen/${district}/${nextMatchNumber}`;
  };

  return (
    <Container>
      <Typography variant="h3" align="center" gutterBottom>
        Scanning Screen
      </Typography>
      {matchData ? (
        <Grid container justifyContent="center" spacing={2}>
          <Grid item xs={6}>
            <Typography variant="h5" align="center" gutterBottom>
              Blue Alliance
            </Typography>
            {matchData.blueAlliance.map((teamNumber, index) => (
              <Typography key={index} align="center" style={{ color: isTeamScanned(teamNumber) ? '#28a745' : '#dc3545' }}>
                {teamNumber} - {isTeamScanned(teamNumber) ? 'Scanned' : 'Not scanned'}
              </Typography>
            ))}
          </Grid>
          <Grid item xs={6}>
            <Typography variant="h5" align="center" gutterBottom>
              Red Alliance
            </Typography>
            {matchData.redAlliance.map((teamNumber, index) => (
              <Typography key={index} align="center" style={{ color: isTeamScanned(teamNumber) ? '#28a745' : '#dc3545' }}>
                {teamNumber} - {isTeamScanned(teamNumber) ? 'Scanned' : 'Not scanned'}
              </Typography>
            ))}
          </Grid>
        </Grid>
      ) : (
        <Typography variant="body1" align="center">
          Loading...
        </Typography>
      )}
      <Grid container justifyContent="center" spacing={2} style={{ marginTop: '20px' }}>
        <Grid item>
          <TextField
            type="text"
            variant="outlined"
            value={inputValue}
            onChange={handleInputChange}
            placeholder="Enter team data..."
            style={{ marginRight: '10px' }}
          />
        </Grid>
        <Grid item>
          <Button variant="contained" onClick={handleAddTeam} style={{ backgroundColor: '#007bff', color: 'white' }}>
            Add Team
          </Button>
        </Grid>
      </Grid>
      <div style={{ textAlign: 'center', marginTop: '20px' }}>
        <Button variant="contained" onClick={handleNextMatch} style={{ backgroundColor: '#28a745', color: 'white' }}>
          Next Match
        </Button>
      </div>
    </Container>
  );
};

export default ScanningScreen;
